import React from 'react';
import styled from 'styled-components';
import { Box, Heading, Text, Link as ChakraLink, List, ListItem } from '@chakra-ui/react';

const palette = {
  primary: '#0F0F0F',
  accent: '#005B41',
  highlight: '#008170',
};

const StyledContact = styled(Box)`
  background-color: ${palette.primary};
  color: ${palette.highlight};
  padding: 4;
  margin-bottom: 8;
  text-align: center;
`;

const Contact = () => {
  return (
    <StyledContact id="contact">
      <Heading as="h2" size="lg" mb="4" color={palette.accent}>
        Contato
      </Heading>
      <Text>
        Você pode entrar em contato comigo das seguintes maneiras:
      </Text>
      <List mt="4">
        <ListItem>
          <Text>
            E-mail: <ChakraLink href="mailto:juliano.amaral@icloud.com" color={palette.accent}>
            juliano.amaral@icloud.com
            </ChakraLink>
          </Text>
        </ListItem>
        <ListItem>
          <Text>
            GitHub: <ChakraLink href="https://github.com/JayGovinda13" target="_blank" color={palette.accent}>
            https://github.com/JayGovinda13
            </ChakraLink>
          </Text>
        </ListItem>
        <ListItem>
          <Text>
            WhatsApp: <ChakraLink href="https://wa.me/+5513997633229" target="_blank" color={palette.accent}>
              Clique para enviar uma mensagem
            </ChakraLink>
          </Text>
        </ListItem>
        {/* Adicione outras informações de contato, como redes sociais, conforme necessário */}
      </List>
    </StyledContact>
  );
};

export default Contact;
